import React, { Component } from "react";
import "./styles.scss";
import { Container, Row, Col, Navbar, NavbarBrand } from "reactstrap";

class Header extends Component {
  render() {
    return (
      <Container fluid={true}>
        <Container>
          <Row>
            <Col>
              <Navbar>
                <NavbarBrand></NavbarBrand>
              </Navbar>
            </Col>
            <Col></Col>
          </Row>
        </Container>
      </Container>
    );
  }
}

export default Header;
